INSERT INTO `catalog_product_entity_text` VALUES (1,75,0,1,'<p>Guinness Gravity Pint Glass</p>\r\n<p><span>Savour a perfectly poured pint of the \'black stuff\' with&nbsp;the new Guinness Gravity Glass; a must-have for the Guinness lover in your life. The Gravity Glass widens at the top and has thin, lengthy walls to help showcase the velvety black color of Guinness.</span></p>\r\n<p><span>With a new, contoured shape, the Guinness Gravity Pint Glass features an embossed Harp on the back of the glass and the Guinness Harp Logo on the front.</span></p>\r\n<ul>\r\n<li><span>20 oz Glass</span></li>\r\n<li><span>New, Contoured Shape</span></li>\r\n<li><span>Features Embossed Harp and Guinness Logo</span></li>\r\n<li><span>Hand Wash Only</span></li>\r\n<li><strong>Gift Box Not Included - <span style=\"text-decoration: underline;\">Used for Presentation Purposes Only</span></strong></li>\r\n</ul>\r\n<p><span><strong>Guinness&reg; Official Merchandise:</strong>&nbsp;This product celebrates an extraordinary brand, which for over two centuries has been held in great affection around the world. For many, Guinness&reg; has come to symbolize a way of life, always with style, wit, and good humor. This product is intended for purchase and enjoyment by people of legal purchase age for alcoholic beverages.</span></p>'),(2,76,0,1,'Guinness Gravity Pint Glass'),(3,85,0,1,'GUINNESS GRAVITY PINT GLASS'),(4,75,0,2,'<p>Guinness Gravity Personalised Pint Glass</p>\r\n<p><strong>Please note:</strong></p>\r\n<ul>\r\n<li>Gift boxes are an optional extra, they are not included in the base cost of the glass</li>\r\n<li>The 15 character limit is imposed in order to maintain the quality of the inscription</li>\r\n<li>The images above are for visualisation purposes only, the final product my vary slightly</li>\r\n</ul>'),(5,76,0,2,'Guinness Gravity Personalised Pint Glass'),(6,85,0,2,'Guinness Gravity Personalised Pint Glass'),(7,75,0,3,'Guinness Gravity 540Ml 4Pk Glass\r\n\r\nThis Guinness Glass 4 Pack is a must-have for any Guinness fan. Containing 4 of the Guinness Gravity Embossed Glasses this pack is the perfect start to your home bar or if you and your family want to drink from the famous glass.\r\n\r\nPerfect home bar starter glass set\r\n4x Guinness Gravity Glasses (540ml)\r\n'),(8,76,0,3,'Guinness Gravity Glass 4 Pack'),(9,85,0,3,'GUINNESS GRAVITY GLASS 4 PACK'),(10,75,0,4,'<p>Guinness Label Black Ceramic Tankard</p>'),(11,76,0,4,'<p>Guinness Label Black Ceramic Tankard</p>'),(12,85,0,4,'Guinness Label Black Ceramic Tankard'),(13,75,0,5,'Guinness Ireland - Tankard With Badge'),(14,76,0,5,'Guinness Ireland - Tankard With Badge'),(15,85,0,5,'Guinness Ireland - Tankard With Badge'),(16,75,0,6,'<p>Guinness Ireland - Ceramic Colour Filled Tankard</p>\r\n<p>Inspired by the classic German \'Stein\', this ceramic Guinness Green Collection Tankard is ideal for enjoying your favourite beverage. Coming from the German \'Stein Krug\' or Stone Jug, this sturdy ceramic tankard is less ornate than the classic Stein; still a must-have for the Guinness lover in your life.</p>\r\n<p><span>Part of the Green Collection, this tankard features a limited edition Guinness Extra Stout label on the front.</span></p>\r\n<ul>\r\n<li><span>Ceramic Tankard with Handle</span></li>\r\n<li><span>Features Limited Edition Extra Stout Label</span></li>\r\n<li><span>Part of the Guinness Green Collection</span></li>\r\n</ul>\r\n<p><span><strong>Guinness&reg; Official Merchandise:</strong>&nbsp;This product celebrates an extraordinary brand, which for over two centuries has been held in great affection around the world. For many, Guinness&reg; has come to symbolize a way of life, always with style, wit, and good humor. This product is intended for purchase and enjoyment by people of legal purchase age for alcoholic beverages.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>&nbsp;</span></p>'),(17,76,0,6,'<p>Guinness Ireland - Ceramic Colour Filled Tankard</p>'),(18,85,0,6,'Guinness Ireland - Green Filled Tankard'),(19,75,0,7,'E-gift card'),(20,76,0,7,'E-gift card'),(21,85,0,7,'E-Gift cart'),(22,175,0,7,'[{\"record_id\":\"0\",\"amount\":\"20\",\"price\":\"20\",\"initialize\":\"1\"},{\"record_id\":\"1\",\"amount\":\"30\",\"price\":\"30\",\"initialize\":\"1\"},{\"record_id\":\"2\",\"amount\":\"40\",\"price\":\"40\",\"initialize\":\"1\"},{\"record_id\":\"3\",\"amount\":\"50\",\"price\":\"50\",\"initialize\":\"1\"},{\"record_id\":\"4\",\"amount\":\"75\",\"price\":\"75\",\"initialize\":\"1\"},{\"record_id\":\"5\",\"amount\":\"100\",\"price\":\"100\",\"initialize\":\"1\"},{\"record_id\":\"6\",\"amount\":\"150\",\"price\":\"150\",\"initialize\":\"1\"},{\"record_id\":\"7\",\"amount\":\"200\",\"price\":\"200\",\"initialize\":\"1\"},{\"record_id\":\"8\",\"amount\":\"250\",\"price\":\"250\",\"initialize\":\"1\"}]'),(23,182,0,7,'6'),(24,183,0,7,'{\"type\":\"Magento\\\\SalesRule\\\\Model\\\\Rule\\\\Condition\\\\Combine\",\"aggregator\":\"all\",\"value\":\"1\",\"new_child\":\"\"}');
